  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is part of a laboratory experiment,
  which evaluated how varying prey densities (year-0 blue king crabs) and habitat
  type (shell and sand) affect the functional response of year-1 blue king crabs,
  crypsis of prey crabs, and foraging behavior of predator crabs. The data includes
  date, experimental duration, tank number, predator species, prey species, predator
  size, substrate type, initial and final prey densities, number of prey eaten, crypsis
  indices, survival, and time spent foraging.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
